package com.example.studentapp.database.questionsdbimport androidx.room.ColumnInfoimport androidx.room.Entityimport androidx.room.PrimaryKey@Entity(tableName = "questions")class QuestionsData(    @ColumnInfo(name = "questionsId") val questionsId: String?,    @ColumnInfo(name = "question") val question: String?,    @ColumnInfo(name = "optionOne") val optionOne: String?,    @ColumnInfo(name = "optionTwo") val optionTwo: String?,    @ColumnInfo(name = "optionThree") val optionThree: String?,    @ColumnInfo(name = "optionFour") val optionFour: String?,    @ColumnInfo(name = "correctOption") val correctOption: String?,) {    @PrimaryKey(autoGenerate = true)    var id: Int? = null    override fun equals(other: Any?): Boolean {        return super.equals(other)    }}